-- Procedure structure for procStatisticsAppear
-- ----------------------------
DROP PROCEDURE IF EXISTS `procStatisticsAppear`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `procStatisticsAppear`()
BEGIN
		DECLARE i, max_num, last_appear, recent_id, not_appear_times INT DEFAULT 0;  
		DECLARE num_str, num_like varchar(10) DEFAULT '';

		select MAX(id) into @recent_id from t_two_color;


		-- for red
		set @i = 1;
		set @max_num = 33;

		while @i <= @max_num do

			IF LENGTH(@i) < 2 THEN
				set @num_str = CONCAT('0', @i);
			ELSE
				set @num_str = @i;
			END IF;
			set @num_like = CONCAT('%',@num_str, '%');

			-- calculate last appear and not appear times
			select MAX(id) into @last_appear from t_two_color where red like @num_like;
			set @not_appear_times = @recent_id - @last_appear;

			-- select @num_str, @num_like, LENGTH(@i), @last_appear;

			IF NOT EXISTS (select 1 from t_appear_red where number = @num_str) THEN
				-- select @i, 'insert';
			ELSE
				-- select @i, 'update';
				update t_appear_red 
				set times = ( select count(1) from t_two_color where red like @num_like), 
						last_appear = @last_appear, 
						not_appear = @not_appear_times 
				where number = @num_str;
			END IF;
			
			set @i = @i + 1;

    end while;


		-- for vlue
		set @i = 1;
		set @max_num = 16;

		while @i <= @max_num do

			IF LENGTH(@i) < 2 THEN
				set @num_str = CONCAT('0', @i);
			ELSE
				set @num_str = @i;
			END IF;

			-- calculate last appear and not appear times
			select MAX(id) into @last_appear from t_two_color where blue like @num_str;
			set @not_appear_times = @recent_id - @last_appear;

			-- select @num_str, @num_like, LENGTH(@i), @last_appear;

			IF NOT EXISTS (select 1 from t_appear_blue where number = @num_str) THEN
				-- select @i, 'insert';
			ELSE
				-- select @i, 'update';
				update t_appear_blue 
				set times = ( select count(1) from t_two_color where blue like @num_str), 
						last_appear = @last_appear, 
						not_appear = @not_appear_times 
				where number = @num_str;
			END IF;
			
			set @i = @i + 1;

    end while;

	END
;;
DELIMITER ;
